import React from 'react';

import '../App.css';

function login() {
  return (
    <div>
      <div className="Login">
        <h1>Login</h1>
        <form action="">
          <p>Usuario</p>
          <input type="text" placeholder="Insira seu usuario" />
          <p></p>
        </form>
      </div>
    </div>
  );
}

export default login;
